import {GoogleMap} from 'react-google-maps';
function  Map(){
return <GoogleMap 
defaultZoom={10}
defaultCenter={{lat:45.421532, }}
/>
}

export default class Google extends Component{
render(){
    return(
        <h1>Helloword</h1>
    )
}
}
